            effectiveVi: 0,
            JSONEffectData: false,
            accstr: 'This wrapper creates very robust statements and pulls all of its info straight from Captivate.  For instance the Parent Activity and description (The ‘accessed’ activity in LRS viewer) comes from the Project Name and Project Description you set in Captivate Preferences>Information.    The activity names come from the names you give each slide.  (The ‘entered’ and ‘viewed’ verbs in LRS viewer).  Each slide activity also uses the same Project Name as the context activities parent.    The IRI ID that each activity and parent needs is created using the base URL of the website it is coming from.     ',
